import React from "react";

function Register() {
  return (
    <div className="contact">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
          
          </div>
          <div class="col-lg-5">
            <h1 class="font-weight-light">Register</h1>
           
          </div>
        </div>
      </div>
    </div>
  );
}

export default Register;
